import './App.css';
import Navbar from './components/Navbar';
import Home from './pages/Home.js';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

function App() {
  return (
    <div className="App">
    <Navbar/>
    <Switch>
    <Route exact path = '/' component={Home}/>
    </Switch>
    </div>
  );
}

export default App;
